function formatNumber(num) {
  // If the input is falsy (null, undefined, empty string), return '0.00'
  if (!num) return '0.00';

  // Convert input to a string
  let strNum = num.toString();

  // Replace ',' with '.' for valid number format
  strNum = strNum.replace(',', '.');

  // Parse the string to a float and format it to two decimal places
  const parsedNum = parseFloat(strNum);

  // If parsing fails, return '0.00'
  if (isNaN(parsedNum)) return '0.00';

  // Return the formatted number to two decimal places
  return parsedNum.toFixed(2);
}

